import React, { useEffect, useState } from 'react';

const Dashboard = () => {
  const [dashboardData, setDashboardData] = useState({
    daily: 5000,
    weekly: 35000,
    monthly: 150000,
  });

  useEffect(() => {
    // Simulate fetching data
    const mockData = {
      daily: 5000,
      weekly: 35000,
      monthly: 150000,
    };

    // Mock API delay (replace with real API data)
    setTimeout(() => {
      setDashboardData(mockData);
    }, 1000); // Simulate 1-second delay
  }, []);

  return (
    <div>
      <h2>Dashboard Overview</h2>
      <div className="kpi-details">
        <p>Total Sales: ${dashboardData.monthly}</p>
        <p>Refund Rate: {dashboardData.refundRate}%</p>
        <p>Top SKUs: {dashboardData.topSKUs}</p>
        <p>Top Creators: {dashboardData.topCreators}</p>
        <p>Campaign ROI: {dashboardData.campaignROI}%</p>
      </div>

      {/* Table displaying daily, weekly, and monthly data */}
      <div className="table-container">
        <h3>Sales Overview</h3>
        <table className="data-table">
          <thead>
            <tr>
              <th>Period</th>
              <th>Amount</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>Daily</td>
              <td>${dashboardData.daily}</td>
            </tr>
            <tr>
              <td>Weekly</td>
              <td>${dashboardData.weekly}</td>
            </tr>
            <tr>
              <td>Monthly</td>
              <td>${dashboardData.monthly}</td>
            </tr>
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Dashboard;
